import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import WelcomeComponent from './WelcomeComponent';
import ListPatientsComponent from './ListPatientsComponent';
import PatientDetailsComponent from './PatientDetailsComponent';
import ListPatientArchiveComponent from './ListPatientArchiveComponent';
import PatientDetailsUpdateCreateComponent from './PatientDetailsUpdateCreateComponent';
import LoginComponent from './LoginComponent';
import LogoutComponent from './LogoutComponent';
import ErrorComponent from './ErrorComponent';
import HeaderComponenet from './HeaderComponent';


export default function PatientsComponent(){
    return (
        <Router>
            <div>
                <HeaderComponenet />
                <Switch>
                    <Route path="/welcome" component={WelcomeComponent} />
                    <Route path="/patients" component={ListPatientsComponent} />
                    <Route path="/archive/patients" component={ListPatientArchiveComponent} />
                    <Route path="/patients/details/id" component={PatientDetailsComponent} />
                    <Route path="/patients/id" component={PatientDetailsUpdateCreateComponent} />

                    <Route path="/" component={LoginComponent} />
                    <Route path="/login" component={LoginComponent} />
                    <Route path="/logout" component={LogoutComponent} />


                    <Route path="*" component={ErrorComponent} />
                </Switch>
            </div>
        </Router>
    );
}
